function Results(props){
  let total = props.physics + props.chemistry + props.maths
  let per = total*100/450
  let results=""
  if (per>=90){
    results="A+"
  }
  if (per>=80 && per<90){
    results="A"
  } 
  if (per>=70 && per<80){
    results="B"
  }
  if (per>=60 && per<70){
    results="C"
  }
  if (per<60){
    results="Fail"
  }
    return(
